  const handleSearch = (query) => {
    console.log('Tìm kiếm với từ khóa:', query);
    // Thực hiện hành động tìm kiếm tại đây
  };

  return (
    <div className="App">
      <Header
        logoSrc={require('./assets/logo.png')}
        logoAlt="Logo"
        onSearch={handleSearch}
      />
      <Footer />
    </div>
  );
}

export default App;
